import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState({});
  useEffect(() => {
    axios.get("/data").then(res => setData(res.data))
                  .catch(err => alert(err));
  }, [data])
  return (
    <div className="App">
      <h6>Message: {data.message}</h6>
      <h6>Date: {data.time}</h6>
    </div>
  );
}

export default App;
